  private void patchRunway()
  {
    importLegacy();
    
    RunwayPatcher.main(new String[]{"--ignoreErrors=true"});
  }
  
  @Transaction
  private void importLegacy()
  {
    // Import metadata that existed before the Runway Patcher was created
    for (int i = 0; i < legacySql.length; ++i)
    {
      Savepoint sp = Database.setSavepoint();
      
      try
      {
        Database.parseAndExecute(legacySql[i]);
      }
      catch (Throwable t)
      {
        Database.rollbackSavepoint(sp);
        logger.warn("Error importing legacy file [" + i + "] (you may be able to ignore this) [" + t.getMessage() + "]");
      }
      finally
      {
        Database.releaseSavepoint(sp);
      }
    }
  }
  
